insert  into `berita_acara`(`id`,`tgl`,`jam`,`judul`,`isi`,`id_karyawan`,`hapus`) values (1,'2015-11-23','11:25:43','TRANSAKSI EDC','Selamt pagi pak,\n\nInformasi 23/11/15 jam 08.30-10.00 WIB daerah simongan mengalami pemadaman listrik. Sehingga mesin EDC secara otomatis\nmati sehingga transaksi pada jam tersebut terhambat dan belum melakukan pembayaran secara EDC. pangkalan yang belum melakukan pembayaran \\\" PAK SAPARIN\\\" dengan transaksi 100 tabung 3KG (Rp 1.425.000,-) dan 10 tabung 12 KG (Rp. 1.328.000,) sehingga pangkalan tersebut melakukan pembayaran besok (24-11-15).\n\nberikut informasi yang saya sampaikan, terima kasih.',5,'1'),(2,'2015-11-27','08:05:36','Hapus double entry kas kecil','Selamat pagi pak,.\n\nMohon dihapuskan ID KKS1511260011 untuk solar H 1757 WH pri tanggal 26 november 2015 karena double entry.\n\nTerima kasih sebelumnya.',9,'0'),(3,'2015-11-27','09:52:17','DOUBLE ENTRY','Selamat pagi pak.\n\npada tgl 26 nov kemarin saya salah double entry energas transaksi pak saparin salah tanggal 25 nov yang seharusnya tgl  26 nov dengan id EGN15112517. \nmohon transaksi tgl 25 nov dengan id tersebut dihapus.\n\nterima kasih,',5,'0'),(4,'2015-11-27','14:20:35','Hapus data','selamat siang pak,.\n\nMohon dihapuskan data dikas kecil ID KKE1511270006, terima dari bank sejumlah Rp. 3.000.000,- karena salah masuk, seharusny masuk di kas masuk.\n\nterima kasih sebelumnya.',9,'1'),(5,'2015-11-28','13:28:33','Mohon hapus data','selamat siang pak...\n\nMohon dihapuskan ID KKE 1511280001 UM 23/27 nov 15, 225.000.\n\nterimakasih sebelumny.',9,'1'),(6,'2015-11-30','09:04:54','hapus data','Selamat pagi pak..\n\nmohon dihapuskan ID KKS 1511280003 solar Hendro tgl 28/11/15.\n\nmakasih sebelumnya...',9,'0'),(7,'2015-12-01','16:59:22','double entry','selamat sore pak.\nmohon dihapuskan id sgj15111612 tgl transaksi tg 16/11/15 no nota 30246\ndan id sgj15120115 tanggal 01/12/15 no nota 030810 karena bouble entry. terima kasih',5,'0'),(8,'2015-12-04','10:05:20','doubel entry','Selamat pagi pak..\n\nMohon dihapuskan ID KKE 151202000 , sola samidi 369.907.  karena double entry.\n\nterima kasih sebelumnya.',9,'1');

/*Table structure for table `karyawan` */

